package hashing;

import java.util.HashMap;

public class AnagramTwoStringUsingHashing {
	
	public static boolean isAnagram(String s, String t)
	{
	HashMap<Character, Integer> hmap = new HashMap<>();
	int sl = s.length();
	int tl = t.length();
	
	if(sl != tl)
		return false;
	
	for(int i=0; i<sl; i++)
	{
		hmap.put(s.charAt(i), hmap.getOrDefault(s.charAt(i),0) +1);
		hmap.put(t.charAt(i), hmap.getOrDefault(t.charAt(i),0) -1);
	}
	
	for(char ch : hmap.keySet())
	{
		if(hmap.get(ch) != 0)
			return false;
	}
	return true;
	
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		String s= "";
		String t= "";
		boolean result = isAnagram(s,t);
		System.out.println(result);


	}

}

/*
 * The hashtable should handle all unicode characters. The time complexity is still O(n) while the space complexity becomes O(n) because of the hashtable.
 */
 
